import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <header className="fixed top-0 left-0 w-full z-50 bg-white/30 backdrop-blur-md shadow-md">
      <nav className="max-w-6xl mx-auto px-6 py-3 flex justify-between items-center text-black">
        <h1 className="text-2xl font-bold tracking-wide font-[Orbitron]">Prajith</h1>
        <ul className="flex space-x-6 font-medium text-sm font-[Orbitron]">
          <li><a href="#home" className="hover:text-gray-700 transition">Home</a></li>
          <li><a href="#about" className="hover:text-gray-700 transition">About</a></li>
          <li><a href="#projects" className="hover:text-gray-700 transition">Projects</a></li>
          <li><a href="#skills" className="hover:text-gray-700 transition">Skills</a></li>
          <li><a href="#contact" className="hover:text-gray-700 transition">Contact</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;


